// 4. Создайте переменную grade и присвойте ей значение от 1 до 5. Используя
// оператор switch, выведите в консоль описание оценки (например, "Отлично",
// "Хорошо" и т.д.) в зависимости от значения переменной grade.
const grade = +prompt();
switch (grade) {
    case grade === 1:
        break;
    default:
        break;
}
